import React from "react"

class About extends React.Component{
    render(){
        return(
            <>
            <div className="about">
                <div className="about-corona">
                   <h1>What Doctors Say</h1>
                   <div className="line"></div>
                </div>
                <div className="corona-intro">
                   <div className="words"><p>Coronaviruses are a type of virus. There are many different kinds, and some cause disease. A coronavirus identified in 2019, SARS-CoV-2, has caused a pandemic of respiratory illness, called COVID-19.</p></div>
                   <div className="doctor"><img src="https://images.unsplash.com/photo-1612349316228-5942a9b489c2?ixid=MnwxMjA3fDB8MHxzZWFyY2h8MzR8fGRvY3RvcnxlbnwwfHwwfHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=600&q=60"></img></div>
                </div>
        
            </div>
            </>
        )
    }
}
export default About
